import React from "react";
import { useDispatch } from "react-redux";
import { login, logout } from "./features/user";
export default function Login() {
  const dispatch = useDispatch();
  return (
    <div>
      <button
        onClick={() => {
          dispatch(
            login({ name: "rishit", age: "20", addr: "raj", fff: "@gmail.com" })
          );
        }}
      >
        login
      </button>
      <button
        onClick={() => {
          dispatch(logout());
        }}
      >
        logout
      </button>
    </div>
  );
}
